PHA avamiseks peab PHA taotleja registri haldajale esitama:
1. PHA elektroonilise taotluse registri veebilehe kaudu;
2. Registrist välja prinditud ja allkirjastatud esimeses punktis nimetatud
elektroonilise taotluse koos vabas vormis kaaskirjaga esitatavate dokumentide ja
konto avamise soovi kohta;
3. Vabas vormis kaaskiri kinnitades registri kasutajatingimustega tutvumist ja
nendega nõustumist;
4. Kasutamistingimuste peatüki 7 all nõutud dokumendid volitatud esindajate ja
täiendavate volitatud esindajate kohta;
5. Tõendi, mis kinnitab, et konto avamist taotlev isik on avanud arveldusarve
Euroopa Majanduspiirkonda kuuluvas liikmesriigis;
6. Kui tegemist on Eesti Vabariigi füüsilise isikuga – isikut tõendava dokumendi
allkirjastatud ja notariaalselt kinnitatud isikuandmete ja fotoga lehekülje koopia.
Isikut tõendavaks dokumendiks on pass või ID-kaart;
7. Kui tegemist on füüsilise isikuga, kes ei ole Eesti Vabariigi kodanik – isikut
tõendava dokumendi allkirjastatud, notariaalselt kinnitatud isikuandmete ja fotoga
lehekülje koopia, mis on apostillitud või legaliseeritud. Leedu, Läti, Venemaa,
Ukraina ja Poola elanike esitatud dokumendi ei pea olema apostillitud ega
legaliseeritud. Haagi konventsiooniga ühinenud riikide elanikud (va Leedu, Läti,
Venemaa, Ukraina ja Poola) peavad esitama apostillitud koopiad. Haagi
konventsiooniga mitte ühinenud riikide elanikud peavad esitama legaliseeritud
koopiad;
8. Kui tegemist on füüsilise isikuga – tõend alalise elukoha aadressi kohta. Esitada
võib riigiasutuse väljastatud muu isikut tõendava dokumendi, milles on märgitud
isiku alalise elukoha aadress või kohaliku omavalitsuse tõendi, mis kinnitab isiku
alalist elukohta;
9. Kui tegemist on Eesti juriidilise isikuga – Eesti äriregistri registrikaardi
allkirjastatud ja notariaalselt kinnitatud koopia;
10. Kui on tegemist väljaspool Eestit registreeritud juriidilise isikuga – juriidilise
isiku asutamis- ja registreerimise dokumendite allkirjastatud ja notariaalselt
kinnitatud koopiad, mis on vastavalt kas apostillitud või legaliseeritud.
11. Juriidilise isiku taotluse puhul – pangakonto andmed;
12. Juriidilise isiku taotluse puhul – Euroopa Majanduspiirkonna liikmesriigi
käibemaksu (VAT) registreerimise kinnituse ja olemasolul käibemaksu
registrikoodi numbri;
13. Juriidilise isiku taotluse puhul – juhtide nimekiri;
14. Juriidilise isiku puhul – juriidilise isiku tegelikult kasusaav omanik vastavalt
