Tegevusloa taotlus peab sisaldama järgmisi andmeid:
- juriidilisest isikust ettevõtja puhul nimi ja registrikood, selle puudumise korral asukohariigi asjakohane identifitseerimistunnus (registreerimisnumbriga võrdsustatav numbri- või tähekombinatsioon), füüsilisest isikust ettevõtja puhul nimi ja registrikood, selle puudumise korral isikukood või sünniaeg ning isikut tõendava dokumendi nimetus ja number;
- ettevõtja kontaktandmed (telefoninumber, elektronposti aadress ja postiaadress);
- teise lepinguriigi või kolmanda riigi ettevõtja puhul asukoha aadress, kui see erineb postiaadressist;
- tegevusala seadusest tulenev nimetus ning äriseadustiku § 4 lõike 6 alusel kehtestatud klassifikaatori kohane nimetus ja kood;
- teatele allakirjutanud isiku nimi ja kontaktandmed (telefoninumber ja elektronposti aadress), juriidilise isiku puhul ka esindusõiguse aluse nimetus (juhatuse liige või volitus);
- kui ettevõtja soovib, et talle antava tegevusloa kehtivusaega piirataks võrreldes seaduses ettenähtuga, siis tegevusloa soovitud kehtivusaeg;
- ettevõtja hoolsuskohustuse täitmise kava, kui ettevõtja on selle esitamiseks käesoleva seaduse alusel kohustatud.
Taotlusele peavad olema lisatud järgmised dokumendid:
- kasutatavate tehnikavahendite loetelu, ülevaade taotleja tegevusest, milleks tegevusluba taotletakse, ning ettevõtja spetsialistide kvalifikatsiooni tõendavate dokumentide (diplomid, tunnistused ja muu selline) koopiad;
- kui valmistajatehas on isikule väljastanud toote hoolduse, kontrolli või remondi teostamiseks loa või tunnistuse, lisatakse selle koopia tegevusloa taotlusele.
Veeteede Amet teeb otsuse 20 tööpäeva jooksul taotluse saamisest arvates. Otsuse tegemise tähtaega võib lisaasjaolude selgitamiseks pikendada 30 päeva võrra, kui see on vajalik üksikjuhtumi keerukuse tõttu. Tähtaja pikendamisest teavitatakse taotluse esitajat.

